import React from 'react'
import { useState, useEffect } from 'react'

function Home() {
    const [data, setData] = useState([]);

    useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/users").then((res) =>{
            const data = res.json();
            console.log(data)
        }).catch((err) =>{
            console.log(err)
        })
    }, [])
    return (
        <div>
            <h1 style={{ marginLeft:'270px' }}>Welcome To Home Page</h1>
        </div>
    )
}

export default Home;
